import { useState } from "react";
import "./App.css";
import SideNav from "./components/SideNav";

function App() {
 const [currentBalance, setCurrentBalance] = useState<number>(2000.50)
  return (
    <div className="App">
      <SideNav />
      <main>
        <div>
          <h2>Current Balance</h2>
          <h1>${currentBalance.toFixed(2)}</h1>
        </div>
      </main>
    </div>
  );
}

export default App;
